function verboseTime(s){if(isNaN(s)){return s;}
let secs=parseInt(s,10);let years=Math.floor(secs /(3600*24*365));secs-=years*3600*24*365;let months=Math.floor(secs /(3600*24*30));secs-=months*3600*24*30;let days=Math.floor(secs /(3600*24));secs-=days*3600*24;let hrs=Math.floor(secs / 3600);secs-=hrs*3600;let mins=Math.floor(secs / 60);secs-=mins*60;let parts=new Array();if(years>0){parts.push(years+' years');}
if(months>0){parts.push(months+' months');}
if(days>0){parts.push(days+' days');}
if(hrs>0){parts.push(hrs+' hrs');}
if(mins>0){parts.push(mins+' mins');}
parts.push(secs+' secs');return implode(' ',parts);}
function ucwords(str){return(str+'').replace(/^([a-z])|\s+([a-z])/g,function($1){return $1.toUpperCase();});}
